# coding=utf-8
from base64 import b64decode

from t39 import rsa_test, encrypt, decrypt


def oracle(m, priv_key):
    return decrypt(m, priv_key) % 2 == 1


# Ключи
pub, private = rsa_test()

plain = "VGhhdCdzIHdoeSBJIGZvdW5kIHlvdSBkb24ndCBwbGF5IGFyb3VuZCB3aXRoIHRoZSBGdW5reSBDb2xkIE1lZGluYQ=="
plain = b64decode(plain)

# Шифрованное сообщение
ciph = encrypt(int.from_bytes(plain, byteorder='big'), pub)
e, n = pub
d, _ = private
# Нижняя оценка
b = 0
# Верхняя оценка
a = n - 1
text = b''
i = 0
while a - b > 0:
    i += 1
    # Сдвиг
    mid = n * ((a * 2 ** i) // n)
    mid //= 2 ** i
    if oracle(ciph * pow(2, e * i, n), private):
        # Число нечётное, сдвигаем нижний предел
        b = mid + 1
    else:
        # Число чётное, сдвигаем верхний предел
        a = mid

    text = a.to_bytes((a.bit_length() + 7) // 8, byteorder='big')
    print(text)


decrypt_num = decrypt(ciph, private)
print(text == decrypt_num.to_bytes((decrypt_num.bit_length() + 7) // 8, byteorder='big'))


